$.isNW=function(n){return n===undefined||n===null||n.toString().trim().length===0};$.timeFormat=function(n,t){if(!$.isNW(n)){t=t||"MM/DD/YYYY hh:mm:ss A";var i=new moment.utc(n).tz("America/Los_Angeles");return i.format(t)}};$.dateFormat=function(n,t){if(!$.isNW(n)){t=t||"MM/DD/YYYY";var i=new moment.utc(n);return i.format(t)}};$.isSuccess=function(n){return n===""};